import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route} from 'react-router-dom';

import ShowProducto from './components/ShowProducto';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/'  element={<ShowProducto/> } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
